import React from "react";

export const Tile = ({name, description}) => {
  return (
    <div className="tile-container">
      <p className="tile-title">{name}</p>
      {Object.values(description).map((item) => { /* object.values() takes in an object and converts its content into */
        return (
          <p>{item}</p>
        )
      })}
    </div>
  );
};
